// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.28;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

// Import the interface for ERC-20 tokens (USDC is an ERC-20 token)
interface IERC20 {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract Vault {
    address public adminWallet;
    IERC20 public usdcToken;

    // Events to log deposits and withdrawals
    event Deposited(address indexed sender, uint256 amount);
    event Withdrawn(address indexed recipient, uint256 amount);

    modifier onlyAdmin() {
        require(msg.sender == adminWallet, "Not the admin");
        _;
    }

    constructor(address _usdcToken, address _adminWallet) {
        adminWallet = _adminWallet;
        usdcToken = IERC20(_usdcToken);
    }

    // Function to deposit USDC into the vault
    function deposit(uint256 amount) external {
        require(amount > 0, "Amount must be greater than zero");

        // Transfer USDC from sender to this contract
        bool success = usdcToken.transferFrom(msg.sender, address(this), amount);
        require(success, "Transfer failed");

        emit Deposited(msg.sender, amount);
    }

    function withdraw() external onlyAdmin() {
        uint256 vaultBalance = usdcToken.balanceOf(address(this));
        require(vaultBalance > 0, "There is no fund to withdraw");

        bool success = usdcToken.transferFrom(address(this), msg.sender, vaultBalance);
        require(success, "Withdrawal failed");
    }

    // Function to check the contract's USDC balance
    function balance() external view returns (uint256) {
        return usdcToken.balanceOf(address(this));
    }
}

